SET QUOTED_IDENTIFIER ON
GO
create function [dbo].[funkcija1]
(@lastname as varchar(20))
returns table as return
(select sum(total_rebounds) as rebounds, sum(points) as points, sum(assists) as assists
from Player_performance, Player
where Player_performance.playerID = Player.playerID
and Player.lastname = @lastname)
